import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import AdminUploadTool from "./components/AdminUploadTool";

const games = [
  { id: 1, teamA: "Cowboys", spreadA: "+4", teamB: "Eagles", spreadB: "-4" },
  { id: 2, teamA: "Packers", spreadA: "-3", teamB: "Bears", spreadB: "+3" },
  { id: 3, teamA: "Chiefs", spreadA: "-7", teamB: "Broncos", spreadB: "+7" }
];

function App() {
  const [picks, setPicks] = useState({});

  const handlePick = (gameId, team) => {
    setPicks((prevPicks) => ({
      ...prevPicks,
      [gameId]: team
    }));
  };

  const handleSubmit = () => {
    console.log("Submitted picks:", picks);
    alert("Picks submitted! (Check console)");
  };

  return (
    <Router>
      <Routes>
        <Route path="/admin-upload" element={<AdminUploadTool />} />
      </Routes>
    </Router>
  );
}

export default App;
